/*Table structure for table `hospital` */

DROP TABLE IF EXISTS `hospital`;

CREATE TABLE `hospital` (
  `id` int(100) NOT NULL AUTO_INCREMENT,
  `hname` varchar(100) DEFAULT NULL,
  `psw` varchar(100) DEFAULT NULL,
  `address` varchar(100) DEFAULT NULL,
  `contact` varchar(100) DEFAULT NULL,
  `bname` varchar(100) DEFAULT 'blood bank',
  `msg` varchar(100) DEFAULT NULL,
  `msg1` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

/*Data for the table `hospital` */

insert  into `hospital`(`id`,`hname`,`psw`,`address`,`contact`,`bname`,`msg`,`msg1`) values (1,'gandhi hospital','123','gandhi road','7890256892','blood bank','Hlo sir','hlo'),(2,'medico hospital','145','tk street','8902560378','blood bank',NULL,NULL);

/*Table structure for table `request` */

DROP TABLE IF EXISTS `request`;

CREATE TABLE `request` (
  `id` int(100) NOT NULL AUTO_INCREMENT,
  `hname` varchar(100) DEFAULT NULL,
  `bd` varchar(100) DEFAULT NULL,
  `name` varchar(100) DEFAULT NULL,
  `status` varchar(100) DEFAULT 'pending',
  `bname` varchar(100) DEFAULT 'blood bank',
  `feedback` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;

/*Data for the table `request` */

insert  into `request`(`id`,`hname`,`bd`,`name`,`status`,`bname`,`feedback`) values (8,'gandhi hospital','O-','yamini','accepted','blood bank','good service');

